	/************************************************************
	 * 
	 * 与服务器创建http协议，返回数据
	 * 
	 * @param map
	 *            请求参数
	 * @param urlAddr
	 *            URL 请求地址
	 * @param encode
	 *            UTF-8 编码
	 * @return 结果
	 ***********************************************************/
	public static String httpPost(Map<String,String> map, String urlAddr,String encode) {
		try {
			URL url = new URL(urlAddr);
			StringBuffer buffer = new StringBuffer();
			
			try {
				for(String keys:map.keySet()){
					buffer.append(keys).append("=").append(URLEncoder.encode(map.get(keys), encode)).append("&");
				}
			} catch (UnsupportedEncodingException e1) {
			}
			
			HttpURLConnection httpURLConnection = null;
			OutputStream outputStream = null;
			try {
				if (null != url) {
					httpURLConnection = (HttpURLConnection) url.openConnection();
					httpURLConnection.setConnectTimeout(6000);
					httpURLConnection.setRequestMethod("POST");
					httpURLConnection.setDoInput(true);
					httpURLConnection.setDoOutput(true);
					httpURLConnection.setInstanceFollowRedirects(true);
					httpURLConnection.setUseCaches(false);
					httpURLConnection.setRequestProperty("Accept","application/json");
					httpURLConnection.setRequestProperty("Content-Type","application/x-www-form-urlencoded");
					String buf = buffer.substring(0, buffer.length() - 1).toString();
					byte[] mydata = buf.getBytes();
					httpURLConnection.setRequestProperty("Content-Length",String.valueOf(mydata.length));
					outputStream = httpURLConnection.getOutputStream();
					outputStream.write(mydata, 0, mydata.length);
					outputStream.close();
					
					
					int responseCode = httpURLConnection.getResponseCode();
					if (responseCode == 200) {
						String result = changeInputStream(httpURLConnection.getInputStream(), encode);
						httpURLConnection.disconnect();
						
						return result;
					}
				}
			} catch (IOException e) {
				//e.printStackTrace();
				return e.getMessage();
			}
		} catch (MalformedURLException e) {
		}
		return "";
	}

	/**
	 * 与服务器创建http协议，返回数据
	  * 以流的形式传送至服务器
	 * @param map
	 *            请求参数
	 * @param urlAddr
	 *            URL 请求地址
	 * @param encode
	 *            UTF-8 编码
	 * @param json
	 * 			 json格式字符串
	 * @return 结果
	 */
	public static String httpPostJson(Map<String,String> map, String urlAddr,String encode,String json) throws IOException {
		
			StringBuffer buffer = new StringBuffer();
			try {
				for(String keys:map.keySet()){
					buffer.append(keys).append("=").append(URLEncoder.encode(map.get(keys), encode)).append("&");
				}
			} catch (UnsupportedEncodingException e1) {
			}
			String buf = buffer.substring(0, buffer.length() - 1).toString();
			StringBuilder stringUrl = new StringBuilder();
			stringUrl.append(urlAddr);
			stringUrl.append("?");
			stringUrl.append(buf);
			HttpPost httpPost = new HttpPost(stringUrl.toString());
			StringEntity entity = new StringEntity(json,encode);//解决中文乱码问题    
	        entity.setContentEncoding(encode);    
	        httpPost.setEntity(entity);
	        CloseableHttpClient httpClient = HttpClients.createDefault();
	        
	      //设置请求和连接超时时间
        	RequestConfig requestConfig = RequestConfig.custom().setSocketTimeout(3000).setConnectTimeout(3000).build();
        	httpPost.setConfig(requestConfig);
	        try {
				CloseableHttpResponse response = httpClient.execute(httpPost);
				if(response != null){
					HttpEntity entity2 = response.getEntity();
					//返回的数据
					String returnString = EntityUtils.toString(entity2, encode);
					return returnString;
				}
			} catch (ClientProtocolException e) {
				e.printStackTrace();
			} catch (IOException e) {
				e.printStackTrace();
			}finally{
				try {
					httpClient.close();
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
		return "";
	}
	
	/**
     * 向指定URL发送GET方法的请求
     * 
     * @param url
     *            发送请求的URL
     * @param param
     *            请求参数，请求参数应该是 name1=value1&name2=value2 的形式。
     * @return URL 所代表远程资源的响应结果
     */
    public static String sendGet(String url, String param) {
        String result = "";
        BufferedReader in = null;
        try {
            String urlNameString = url + "?" + param;
            URL realUrl = new URL(urlNameString);
            // 打开和URL之间的连接
            URLConnection connection = realUrl.openConnection();
            // 设置通用的请求属性
            connection.setRequestProperty("accept", "*/*");
            connection.setRequestProperty("connection", "Keep-Alive");
            connection.setRequestProperty("user-agent", "Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1;SV1)");
            // 建立实际的连接
            connection.connect();
            // 获取所有响应头字段
            Map<String, List<String>> map = connection.getHeaderFields();
            // 遍历所有的响应头字段
            for (String key : map.keySet()) {
                System.out.println(key + "--->" + map.get(key));
            }
            // 定义 BufferedReader输入流来读取URL的响应
            in = new BufferedReader(new InputStreamReader(connection.getInputStream()));
            String line;
            while ((line = in.readLine()) != null) {
                result += line;
            }
        } catch (Exception e) {
            System.out.println("发送GET请求出现异常！" + e);
            e.printStackTrace();
        }
        // 使用finally块来关闭输入流
        finally {
            try {
                if (in != null) {
                    in.close();
                }
            } catch (Exception e2) {
                e2.printStackTrace();
            }
        }
        return result;
    }

	/**
     * 向指定 URL 发送POST方法的请求
     * 
     * @param url
     *            发送请求的 URL
     * @param param
     *            请求参数，请求参数应该是 name1=value1&name2=value2 的形式。
     * @return 所代表远程资源的响应结果
     */
    public static String sendPost(String url, String param) {
        PrintWriter out = null;
        BufferedReader in = null;
        String result = "";
        try {
            URL realUrl = new URL(url);
            // 打开和URL之间的连接
            URLConnection conn = realUrl.openConnection();
            // 设置通用的请求属性
            conn.setRequestProperty("contentType", "application/x-www-form-urlencoded");
            conn.setRequestProperty("accept", "*/*");
            conn.setRequestProperty("connection", "Keep-Alive");
            conn.setRequestProperty("user-agent","Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1;SV1)");
            // 发送POST请求必须设置如下两行
            conn.setDoOutput(true);
            conn.setDoInput(true);
            // 获取URLConnection对象对应的输出流
            out = new PrintWriter(conn.getOutputStream());
            // 发送请求参数
            out.print(param);
            // flush输出流的缓冲
            out.flush();
            // 定义BufferedReader输入流来读取URL的响应
            in = new BufferedReader(new InputStreamReader(conn.getInputStream()));
            String line;
            while ((line = in.readLine()) != null) {
                result += line;
            }
        } catch (Exception e) {
            System.out.println("发送 POST 请求出现异常！"+e);
            e.printStackTrace();
        }
        //使用finally块来关闭输出流、输入流
        finally{
            try{
                if(out!=null){
                    out.close();
                }
                if(in!=null){
                    in.close();
                }
            }
            catch(IOException ex){
                ex.printStackTrace();
            }
        }
        return result;
    } 

	/**********************************************************************
	 * 
	 * 获得content流转换成字符串
	 * 
	 * @param inputStream
	 *            输入流
	 * @param encode
	 *            编码
	 * @return 结果
	 *********************************************************************/
	private static  String changeInputStream(InputStream inputStream,String encode) {
		ByteArrayOutputStream out = new ByteArrayOutputStream();
		Map<String, String> resultMap =null;
		if (null != inputStream) {
			byte[] buff = new byte[1024];
			int len = 0;
			try {
				while ((len = inputStream.read(buff)) != -1) {
					out.write(buff, 0, len);
				}
				byte[] result = out.toByteArray();
				if(result.length > 0)
				{
//					String resultStr = new String(out.toByteArray(), "UTF-8");
//					resultMap = WXUtils.doXMLParse(resultStr);
					return  new String(out.toByteArray(), encode);	
				}
			} catch (Exception e) {
				e.printStackTrace();
			} finally {
				if(null != out) {
					try {
						out.close();
					} catch (IOException e) {
						e.printStackTrace();
					}
				}
			}
		}
		
		
		return "";
	}
	
	/**
	 * 
	 * 发送json格式的httpPost请求
	 *
	 */
	public static String httpPostJson(String urlstring,String json){
		try {
			//创建链接
			URL url = new URL(urlstring);
			HttpURLConnection connection = (HttpURLConnection) url.openConnection();
			connection.setDoOutput(true);
			connection.setDoInput(true);
			connection.setRequestMethod("POST");
			//connection.setUseCaches(false);
			connection.setAllowUserInteraction(true);
			connection.setInstanceFollowRedirects(true);
			connection.setRequestProperty("Content-Type", "application/x-www-form-urlencoded");
			connection.connect();
			
			//POST 请求
			DataOutputStream out = new DataOutputStream(connection.getOutputStream());
			json += "data="+json;
			out.writeBytes(json);
			out.flush();
			out.close();
			
			//读取响应
			BufferedReader reader = new BufferedReader(new InputStreamReader(connection.getInputStream()));
			String lines;
			StringBuffer sb = new StringBuffer("");
			while((lines = reader.readLine())!=null){
				lines = new String(lines.getBytes(),"utf-8");
				sb.append(lines);
			}
			System.out.println(sb);
			reader.close();
			connection.disconnect();
			return sb.toString();
		} catch (MalformedURLException e) {
			e.printStackTrace();
		} catch (UnsupportedEncodingException e) {
			e.printStackTrace();
		} catch (IOException e) {
			e.printStackTrace();
		}
		return "";
	}
	/**
	 * 
	 * post地址参数
	 * 
	 * @param url 地址
	 * 
	 * @param encode 编码
	 * 
	 * @param method
	 * 			POST GET
	 * @return
	 */
	public static String http(String url,String encode,String method){
		try {
			URL uri = new URL(url);
			HttpURLConnection conn =(HttpURLConnection) uri.openConnection();
			conn.setRequestProperty("Accept-Charset",encode);
			conn.setRequestMethod(method);
			int code = conn.getResponseCode();
			if (code == 200) {
				InputStream is =conn.getInputStream();
				String result = changeInputStream(is, encode);
				conn.disconnect();
				return result;
			}
		} catch (Exception e) {
				e.printStackTrace();
		}
		return "";
	}
	
	
